import { createRouter, createWebHistory } from "vue-router";
import AdminProfile from "../components/admin/AdminProfile.vue";
import ProductList from "../components/admin/ProductList.vue";
import UserList from "../components/admin/UserList.vue";
import RegisterPage from "../views/Register.vue";
import LoginPage from "../components/Login.vue";
import HomePage from "../components/Home.vue";
import UserProfile from "../components/user/UserProfile.vue";
import ShoppingCart from "../components/user/UserCart.vue"; // Assuming you have a ShoppingCart component

const routes = [
  {
    path: "/",
    name: "HomePage",
    component: HomePage,
  },
  {
    path: "/admin-profile",
    name: "AdminProfile",
    component: AdminProfile,
  },
  {
    path: "/product-list",
    name: "ProductList",
    component: ProductList,
  },
  {
    path: "/user-list",
    name: "UserList",
    component: UserList,
  },
  {
    path: "/register",
    name: "RegisterPage",
    component: RegisterPage,
  },
  {
    path: "/login",
    name: "LoginPage",
    component: LoginPage,
  },
  {
    path: "/user-profile",
    name: "UserProfile",
    component: UserProfile,
  },
  {
    path: "/cart",
    name: "ShoppingCart",
    component: ShoppingCart,
  },
  {
    path: "/products",
    name: "Products",
    component: ProductList, // Assuming ProductList is the component for products
  },
  {
    path: "/profile",
    name: "Profile",
    component: UserProfile, // Assuming UserProfile is the component for profile
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
